	add("ratiocination", "{\"term\":\"ratiocination\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027ratiocination\u0027 from Latin \u0027ratiocinatio|lang\u003dla\u0027 () from \u0027\u0027 past participle of \u0027ratiocinari\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Reasoning, conscious deliberate inference; the activity or process of reasoning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1663\u0027\u0027, Hudibras\u0027, by Samuel Butler, part 1, s:Hudibras/Part 1/Canto canto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He\u0027d run in debt by disputation, And pay with ratiocination\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1916\u0027\u0027, New York Times, \u0026quot;[http://select.nytimes.com/gst/abstract.html?res\u003dF10F1EF73B5512738FDDA10894DE405B868DF1D3 Suffrage at Chicago]\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It is hard to follow the kinks of woman suffrage \u0027\u0027ratiocination\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Thought or reasoning that is exact, valid and rational\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A proposition arrived at by such thought\", \"priority\":7}]}, \"synonyms\":{}}");

