	add("ratissage", "{\"term\":\"ratissage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027ratissage\u0027 from \u0027ratisser\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A raid (especially violent) carried out by the police or military, originally and chiefly carried out by the French in Algeria\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1977\u0027\u0027, \u0027A Savage War of Peace\u0027, New York Review Books 2006, p. 26\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The army […] subjected suspect Muslim villages to systematic \u0027\u0027\u0027ratissage\u0027\u0027\u0027 – literally a ‘raking-over’, a time-honoured word for ‘pacifying’ operations\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027Super-Cannes\u0027, Fourth Estate 2011, p. 220\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A second group of security men had appeared from within the museum, and lashed out with their clubs like warriors in a battle scene from a Kurasawa epic. […] ‘It\u0027s another \u0027\u0027ratissage\u0027\u0027. A special action.’\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A monetary device whereby national reserves are temporarily given up to a central bank\", \"priority\":6}]}, \"synonyms\":{}}");

	add("ratshit", "{\"term\":\"ratshit\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The excrement of a rat\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, w:Larry Larry McMurtry, \u0027Somebody′s Darling\u0027, 2002, [http://books.google.com.au/books?id\u003dW7dJ_gN37GIC\u0026amp;pg\u003dPA228\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnOj7T_vWKurhmAXIv8yYBQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ratshit%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 228\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"“Do you think they have \u0027\u0027ratshit\u0027\u0027 in them?” Wynkyn asked. “Swan says most hamburgers have \u0027\u0027ratshit\u0027\u0027 in them\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, w:Gabrielle Gabrielle Carey, \u0027Just Us\u0027, [http://books.google.com.au/books?id\u003do57aAAAAMAAJ\u0026amp;q\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBEL9T7X_EKmeiAfG3NTlBg\u0026amp;redir_esc\u003dy page 106\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"‘Terry stop it! R—′s on, remember. If we get busted we′re \u0027\u0027ratshit\u0027\u0027. We′ll never see each other again\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, w:Stephen Stephen King, \u0027w:The The Tommyknockers\u0027, [http://books.google.com.au/books?id\u003d_EwdaKZmwfIC\u0026amp;pg\u003dPT500\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnOj7T_vWKurhmAXIv8yYBQ\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ratshit%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"He slammed the choke in again. ‘\u0027No, don′t you stall, you \u0027\u0027ratshit\u0027\u0027 plane\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, w:James P. James P. Hogan, \u0027The Multiplex Man\u0027, 2011, [http://books.google.com.au/books?id\u003dhgrnwFs27s0C\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBEL9T7X_EKmeiAfG3NTlBg\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ratshit%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 46\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"“Aw, who cares? It′s all going to hell anyway. You have your turn, eat, get drunk, screw; and fifty years from now none of it′ll matter a \u0027\u0027ratshit\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Anne Cameron. \u0027Wedding Cakes, Rats and Rodeo Queens\u0027, [http://books.google.com.au/books?id\u003d8VNaAAAAMAAJ\u0026amp;q\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnOj7T_vWKurhmAXIv8yYBQ\u0026amp;redir_esc\u003dy page 61\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"So they pulled the furniture away from the wall and found a pile of little dried \u0027\u0027ratshit\u0027\u0027 pellets behind the dresser\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Nonsense, bullshit\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, w:Janette Turner Janette Turner Hospital, \u0027After Long Absence\u0027, \u0027Dislocations\u0027, [http://books.google.com.au/books?id\u003djaK9I6-GtN0C\u0026amp;pg\u003dPA205\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnOj7T_vWKurhmAXIv8yYBQ\u0026amp;redir_esc\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ratshit%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 205\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"He also said that most of the kids at school were full of \u0027\u0027ratshit\u0027\u0027 and that only one or two sheilas made the place any better than buggery\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Irene Moores, Arthur Murray, Aboriginal Deaths in Custody Watch Committee, \u0027Voices of Aboriginal Australia: Past, Present, Future\u0027, [http://books.google.com.au/books?id\u003djWNLAAAAYAAJ\u0026amp;q\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBEL9T7X_EKmeiAfG3NTlBg\u0026amp;redir_esc\u003dy page 49\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Do you see, Mr Bryant, why your old dream of getting to where you could \u0027really\u0027 do something at last is going to be proved to be so much \u0027\u0027ratshit\u0027\u0027? Do you see why self-determination that isn′t really real \u0027is\u0027 so much \u0027\u0027ratshit\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, William J. Lines, \u0027Patriots: Defending Australia′s Natural Heritage\u0027, [http://books.google.com.au/books?id\u003dBUIvEeBB4IwC\u0026amp;pg\u003dPA257\u0026amp;dq\u003d%22ratshit%22+-intitle:%22%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dBEL9T7X_EKmeiAfG3NTlBg\u0026amp;redir_esc\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22ratshit%22%20-intitle%3A%22%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 257\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"Kerin, one of the most pro-development Ministers, told his colleagues: ‘The EIS is \u0027\u0027ratshit\u0027\u0027 and the guidelines are laughable’\", \"priority\":23}]}, \"synonyms\":{}}");

	add("rattan", "{\"term\":\"rattan\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Malay\"], \"text\":\"From Malay \u0027rotan\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several species of climbing palm of the genus \u0027Calamus\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The plant used as a material\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A cane made from this material\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, Walter William Skeat, Charles Otto Blagden, \u0027Pagan Races of the Malay Peninsula\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He who first acts as striker asks the other how many blows of the \u0027\u0027rattan\u0027\u0027 he will bear on his forearm without crying out\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"“My Continental prominence is improving,” I commented dryly. ¶ Von Lindowe cut at a furze bush with his silver-mounted \u0027\u0027rattan\u0027\u0027. ¶ “Quite so,” he said as dryly, his hand at his mustache. “I may say if your intentions were known your life would not be worth a curse\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jean-François Bayart, Andrew Brown, \u0027Global Subjects: A Political Critique of Globalization\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027rattan\u0027\u0027 is still a valued instrument of discipline\", \"priority\":8}]}, \"synonyms\":{}}");

