	add("ratter", "{\"term\":\"ratter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|rat|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything which catches rats, especially a dog trained to catch them; a rat terrier\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who rats; a traitor; a deserter\", \"priority\":2}]}, \"synonyms\":{}}");

	add("ratting", "{\"term\":\"ratting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The blood sport of setting a dog upon rats confined in a pit to see how many he will kill in a given time\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, Ronald H. Fritze, ‎James Stuart Olson, ‎Randy Roberts, \u0027Reflections on World Civilization: A Reader\u0027 (volume 2, page 102\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Henry Mayhew, the nineteenth-century chronicler of London\u0027s underworld, described the frenzied activity of one \u0027\u0027ratting\u0027\u0027 contest. A terrier — the best of ratting dogs — was placed into a pit with 50 rats\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Colin D. Howell, \u0027Blood, Sweat and Cheers: Sport and the Making of Modern Canada\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Bear and bull baiting, dog fights, cockfighting, \u0027\u0027ratting\u0027\u0027, and other blood sports were attacked as un-Christian\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Rob Boddice, \u0027A History of Attitudes and Behaviours Toward Animals in Eighteenth- and Nineteenth-Century Britain\u0027 (page 257\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The RSPCA were well aware that \u0027\u0027ratting\u0027\u0027 was legally ambiguous, and when they received a report of a conviction for ratting in Hull in 1868 they doubted the legality of it\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Jan Bondeson, \u0027Amazing Dogs: A Cabinet of Canine Curiosities\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"This was the pit for dog fights, cockfights and rat killing. At a time when \u0027\u0027ratting\u0027\u0027 was largely frowned upon by respectable people in Britain, it gained considerable support in France\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A vocation involving the pest control of rats, typically using a working terrier\", \"priority\":10}]}, \"synonyms\":{}}");

	add("rattle", "{\"term\":\"rattle\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Verb from Middle english (1100-1500) either from Old english (ca. 450-1100) (not attested) or Middle dutch (ca. 1050-1350) \u0027ratelen\u0027 ultimately imitative. The noun (c. 1500) is from the verb.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Anthony Rattle thumb|a baby with a rattle (2\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a sound made by loose objects shaking or vibrating against one another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I wish they would fix the \u0027\u0027rattle\u0027\u0027 under my dashboard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027rattle\u0027\u0027 of a drum\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A baby\u0027s toy designed to make sound when shaken, usually containing loose grains or pellets in a hollow container\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Alexander Pop\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Pleased with a \u0027\u0027rattle\u0027\u0027, tickled with a straw\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A device that makes a rattling sound such as put on an animal so its location can be heard\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A musical instrument that makes a rattling sound\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Raleig\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027rattles\u0027\u0027 of Isis and the cymbals of Brasilea nearly enough resemble each other\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Noisy, rapid talk\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Hakewil\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"All this ado about the golden age is but an empty \u0027\u0027rattle\u0027\u0027 and frivolous conceit\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A noisy, senseless talker; a jabberer\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"It may seem strange that a man who wrote with so much perspicuity, vivacity, and grace, should have been, whenever he took a part in conversation, an empty, noisy, blundering \u0027\u0027rattle\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A scolding; a sharp rebuke\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Any organ of an animal having a structure adapted to produce a rattling sound\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027rattle\u0027\u0027 of the rattlesnake is composed of the hardened terminal scales, loosened in succession, but not cast off, and modified in form so as to make a series of loose, hollow joints\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"The noise in the throat produced by the air in passing through mucus which the lungs are unable to expel; death rattle\", \"priority\":21}]}, \"synonyms\":{}}");

	add("rattlepod", "{\"term\":\"rattlepod\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|rattle|pod|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various plants, including \u0027Senna covesii\u0027 and species of \u0027Crotalaria\u0027 and \u0027Astragalus\u0027, whose seeds rattle in the pod when shaken\", \"priority\":1}]}, \"synonyms\":{}}");

	add("rattler", "{\"term\":\"rattler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|rattle|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rattlesnake\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A freight train or, a decrepit passenger train\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something which rattles\", \"priority\":3}]}, \"synonyms\":{}}");

	add("rattlewort", "{\"term\":\"rattlewort\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"From Old english (ca. 450-1100) {{m|ang|hraetelwyrt}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Rattlebox\", \"priority\":1}]}, \"synonyms\":{}}");

